import React, { useState } from "react";
import SearchIcon from "@material-ui/icons/Search";
import ViewQuiltIcon from "@material-ui/icons/ViewQuilt";
import NotificationsIcon from "@material-ui/icons/Notifications";
import PersonIcon from "@material-ui/icons/Person";
import { TextField, InputAdornment, Menu, MenuItem } from "@material-ui/core";
import Grid from "@material-ui/core/Grid";
import Button from "@material-ui/core/Button";

export default function HeaderNav() {
  const [anchorEl, setAnchorEl] = useState(null);
  const handleClose = () => {
    setAnchorEl(null);
  };

  return (
    <>
      <Grid
        container
        spacing={0}
        direction="row"
        className="bgr-admin px-3"
        alignItems="center"
      >
        <Grid item xs="6">
          <Button href="/admin" className="header-nav-title color-black">
            Dashboard
          </Button>
        </Grid>
        <Grid
          item
          xs="6"
          className="d-flex"
          direction="row"
          alignItems="center"
          justifyContent="flex-end"
        >
          <TextField
            id="standard-basic"
            label="Search"
            variant="standard"
            InputProps={{
              endAdornment: (
                <InputAdornment position="end">
                  <SearchIcon />
                </InputAdornment>
              ),
            }}
          />
          <Button href="/admin" className="color-black">
            <ViewQuiltIcon />
          </Button>
          <Button className="color-black">
            <NotificationsIcon />
          </Button>
          <Button
            onClick={(e) => setAnchorEl(e.currentTarget)}
            className="color-black"
          >
            <PersonIcon />
          </Button>
          <Menu
            id="menu-user"
            anchorEl={anchorEl}
            keepMounted
            open={Boolean(anchorEl)}
            onClose={handleClose}
          >
            <MenuItem onClick={handleClose}>Profile</MenuItem>
            <MenuItem onClick={handleClose}>Settings</MenuItem>
            <MenuItem onClick={handleClose}>Logout</MenuItem>
          </Menu>
        </Grid>
      </Grid>
    </>
  );
}
